import React, { Component } from 'react'
import { Row,Col,Image,Container } from 'react-bootstrap';
import ada from "./ada.jpg"


export default class Menu extends Component {
    render() {
        return (
            <div>
                <img src={ada} alt="ada"></img>

            </div>
        )
    }
}
